import React, { useState } from 'react';
import './Projects.css';

const Projects = () => {
  const [filter, setFilter] = useState('all');
  
  const projects = [
    {
      id: 1,
      title: "E-Commerce Platform",
      description: "A full-stack e-commerce platform with payment integration.",
      imageUrl: "/placeholder.jpg", // Replace with actual image
      category: "fullstack",
      technologies: ["React", "Node.js", "MongoDB", "Stripe"],
      liveUrl: "#",
      codeUrl: "#"
    },
    {
      id: 2,
      title: "Social Media Dashboard",
      description: "Interactive dashboard for social media analytics.",
      imageUrl: "/placeholder.jpg", // Replace with actual image
      category: "frontend",
      technologies: ["React", "Redux", "Chart.js", "SASS"],
      liveUrl: "#",
      codeUrl: "#"
    },
    {
      id: 3,
      title: "Real-time Chat App",
      description: "Chat application with real-time messaging features.",
      imageUrl: "/placeholder.jpg", // Replace with actual image
      category: "fullstack",
      technologies: ["React", "Node.js", "Socket.io", "MongoDB"],
      liveUrl: "#",
      codeUrl: "#"
    },
    {
      id: 4,
      title: "Restaurant Management System",
      description: "Backend system for restaurant order management.",
      imageUrl: "/placeholder.jpg", // Replace with actual image
      category: "backend",
      technologies: ["Node.js", "Express", "PostgreSQL", "Redis"],
      liveUrl: "#",
      codeUrl: "#"
    },
    {
      id: 5,
      title: "Portfolio Website",
      description: "Responsive developer portfolio website.",
      imageUrl: "/placeholder.jpg", // Replace with actual image
      category: "frontend",
      technologies: ["React", "CSS3", "Framer Motion"],
      liveUrl: "#",
      codeUrl: "#"
    },
    {
      id: 6,
      title: "Netflix Clone",
      description: "A clone of Netflix with similar UI and features.",
      imageUrl: "/placeholder.jpg", // Replace with actual image
      category: "clone",
      technologies: ["React", "CSS", "Firebase", "TMDB API"],
      liveUrl: "#",
      codeUrl: "#"
    }
  ];
  
  const filteredProjects = filter === 'all' 
    ? projects 
    : projects.filter(project => project.category === filter);
  
  return (
    <section id="projects" className="projects-section">
      <h2 className="section-title">My Projects</h2>
      
      <div className="projects-filter">
        <button 
          className={filter === 'all' ? 'active' : ''} 
          onClick={() => setFilter('all')}
        >
          All
        </button>
        <button 
          className={filter === 'frontend' ? 'active' : ''} 
          onClick={() => setFilter('frontend')}
        >
          Frontend
        </button>
        <button 
          className={filter === 'backend' ? 'active' : ''} 
          onClick={() => setFilter('backend')}
        >
          Backend
        </button>
        <button 
          className={filter === 'fullstack' ? 'active' : ''} 
          onClick={() => setFilter('fullstack')}
        >
          Full-stack
        </button>
        <button 
          className={filter === 'clone' ? 'active' : ''} 
          onClick={() => setFilter('clone')}
        >
          Clones
        </button>
      </div>
      
      <div className="projects-container">
        {filteredProjects.map(project => (
          <div className="project-card" key={project.id}>
            <div className="project-image">
              <img src={project.imageUrl} alt={project.title} />
              <div className="project-links">
                <a href={project.liveUrl} target="_blank" rel="noopener noreferrer">Live Demo</a>
                <a href={project.codeUrl} target="_blank" rel="noopener noreferrer">View Code</a>
              </div>
            </div>
            <div className="project-info">
              <h3>{project.title}</h3>
              <p>{project.description}</p>
              <div className="project-tech">
                {project.technologies.map((tech, index) => (
                  <span key={index}>{tech}</span>
                ))}
              </div>
            </div>
          </div>
        ))}
      </div>
    </section>
  );
};

export default Projects;
